var acalert={alertError:function(t){swal("提示",t,"error")},alertInfo:function(t){swal("提示",t,"warning")},alertInfoWithTitle:function(t){swal(t.title,t.msg)},alertSuccess:function(n){var t="恭喜！";n.title&&(t=n.title),swal({title:t,text:n.msg,icon:"success"}).then(function(t){t&&n.confirmCallback()})},alertOneInput:function(n){swal({text:n.text,content:{element:"input",attributes:{placeholder:n.placeholder?n.placeholder:""}},buttons:n.confirm_text}).then(function(t){if(!t)throw null;n.confirmCallback(t)}).catch(function(t){t?swal("出错啦！","The AJAX request failed!","error"):(swal.stopLoading(),swal.close())})},alertConfirm:function(n){swal({title:"警告",text:n.msg,icon:"warning",buttons:["取消","确定"],dangerMode:!0}).then(function(t){t&&n.confirmCallback()})}};